import React from "react";
import {
  CloseIcon,
  Icon,
  SidebarContainer,
  SidebarLink,
  SidebarWrapper,
  SidebarMenu,
  SidebarRoute,
  SideBtnWrapper,
} from "./SidebarElements";

const Sidebar = () => {
  return (
    <SidebarContainer isOpen>
      <Icon>
        <CloseIcon />
      </Icon>
      <SidebarWrapper>
        <SidebarMenu>
          <SidebarLink to="about">About</SidebarLink>
        </SidebarMenu>
        <SidebarMenu>
          <SidebarLink to="discover">Discover</SidebarLink>
        </SidebarMenu>
        <SidebarMenu>
          <SidebarLink to="signup">Sign Up</SidebarLink>
        </SidebarMenu>
        <SideBtnWrapper>
          <SidebarRoute to="/signin"> Sign In</SidebarRoute>
        </SideBtnWrapper>
      </SidebarWrapper>
    </SidebarContainer>
  );
};

export default Sidebar;
